import React,{ Component } from "react"
import "./Header.css"

class Header extends Component{
    constructor(props){
        super(props)
    }
    render(){
        return(
            <div className="Header">
                {this.props.title}
            <div id="box"></div>
            </div>
        )
    }
}
export default Header
